import React from 'react'
import AddTicket from './AddTicket'

function UpdateTicket() {
  return (
    <div className='update-ticket'>
        <div className='left'><AddTicket/></div>
        <div className='right'></div>
    </div>
      
  )
}

export default UpdateTicket
